		Content: string("\n      * {\n        box-sizing: border-box;\n      }\n\n      html, footer, .footer {\n        background-color: #10394d;\n      }\n      \n      body {\n        font-family: 'Lato', sans-serif;\n        text-align: center;\n        background-color: #10394d;\n      }\n\n      footer, .footer, .greyed-text, .greyed-text:hover {\n        color: #ccc;\n      }\n      \n      h1 {\n        color: #ccc;\n        font-size: 2em;\n        font-weight: 300;\n        margin:0 auto;\n      }\n      \n      button.round-btn {\n        display: block;\n        border-radius: 100%;\n        border: none;\n        outline: none;\n        margin: 28px;\n        padding: 20px;        \n        box-shadow: 3px 3px 7px #333;\n      }\n      button:active {\n        box-shadow: none;\n      }\n      \n      svg {\n        fill: white;\n        width: 64px;\n        height: 64px;\n      }\n      \n      button.right-side {\n        background-color: #03a9f4;\n      }\n\n      .remote-buttons section {\n        display: inline-block;\n      }\n      \n      .remote-buttons {\n        position: relative;\n      }\n      \n      /* .vol-section:after {\n        content: \"\";\n        position: absolute;\n        left: 50%;\n        top: 50%;\n        transform: translate(-50%, -50%);\n        background-color: #517e8b;\n        width: 4px;\n        height: 65%;\n        box-shadow: 2px 2px 7px #333;\n      } */\n      \n      .remote {\n        display: inline-block;\n        padding: 32px 0;\n      }\n      \n      .power {\n        background-color: #ff1538;\n      }\n      \n      .source {\n        background-color: #ff8f01;\n      }\n\n      .volume-slider {\n        -webkit-appearance: slider-vertical;\n        position: absolute;\n        left: 49.5%;\n        top: 50%;\n        transform: translate(-50%, -50%);\n        background-color: #517e8b;\n        width: 4px;\n        height: 65%;\n        box-shadow: 2px 2px 7px #333;\n      }\n\n      \n          ")